tigation by the Office of the Chief Medical Examiner which includes the toxicity report, death certificate, as well as a scene investigation.\n\nThe “Morphine (Not Heroin)” values are related to the differences between how Morphine and Heroin are metabolized and therefor detected in the toxicity results. Heroin metabolizes to 6-MAM which then metabolizes to morphine.  6-MAM is unique to heroin, and has a short half-life (as does heroin itself). Thus, in some heroin deaths, the toxicity results will not indicate whether the morphine is from heroin or prescription morphine. In these cases the Medical Examiner may be able to determine the cause based on the scene investigation (such as  finding heroin needles). If they find prescription morphine at the scene it is certified as “Morphine (not heroin).”  Therefor, the Cause of Death may indicate Morphine, but the Heroin or Morphine (Not Heroin) may not be indicated.\n\n “Any Opioid” – If the Medical Examiner cannot conclude whether it’s RX Morphine or heroin based morphine in the toxicity results, that column may be checked','a listing of each accidental death associated with drug overdose in connecticut from 2012 to 2018. a \"y\" value under the different substance columns indicates that particular substance was detected.\n\ndata are derived from an investigation by the office of the chief medical examiner which includes the toxicity report, death certificate, as well as a scene investigation.\n\nthe “morphine (not heroin)” values are related to the differences between how morphine and heroin are metabolized and therefor detected in the toxicity results. heroin metabolizes to 6-mam which then metabolizes to morphine.  6-mam is unique to heroin, and has a short half-life (as does heroin itself). thus, in some heroin deaths, the toxicity results will not indicate whether the morphine is from heroin or prescription morphine. in these cases the medical examiner may be able to determine the cause based on the scene investigation (such as  finding heroin needles). if they find prescription morphine at the scene it is certified as “morphine (not heroin).”  therefor, the cause of death may indicate morphine, but the heroin or morphine (not heroin) may not be indicated.\n\n “any opioid” – if the medical examiner cannot conclude whether it’s rx morphine or heroin based morphine in the toxicity results, that column may be checked'),(1272174,'a','a'),(1272175,'listing','listing'),(1272176,'each','each'),(1272177,'death','death'),(1272178,'associated','associated'),(1272179,'with','with'),(1272180,'overdose','overdose'),(1272181,'in','in'),(1272182,'connecticut','connecticut'),(1272183,'from','from'),(1272184,'2012','2012'),(1272185,'to','to'),(1272186,'2018','2018'),(1272187,'y','y'),(1272188,'value','value'),(1272189,'under','under'),(1272190,'different','different'),(1272191,'substance','substance'),(1272192,'columns','columns'),(1272193,'indicates','indicates'),(1272194,'that','that'),(1272195,'particular','particular'),(1272196,'was','was'),(1272197,'detected','detected'),(1272198,'data','data'),(1272199,'are','are'),(1272200,'derived','derived'),(1272201,'an','an'),(1272202,'investigation','investigation'),(1272203,'by','by'),(1272204,'which','which'),(1272205,'includes','includes'),(1272206,'toxicity','toxicity'),(1272207,'report','report'),(1272208,'certificate','certificate'),(1272209,'as','as'),(1272210,'well','well'),(1272211,'scene','scene'),(1272212,'morphine','morphine'),(1272213,'not','not'),(1272214,'heroin','heroin'),(1272215,'values','values'),(1272216,'differences','differences'),(1272217,'between','between'),(1272218,'how','how'),(1272219,'metabolized','metabolized'),(1272220,'therefor','therefor'),(1272221,'results','results'),(1272222,'metabolizes','metabolizes'),(1272223,'6-mam','6-mam'),(1272224,'then','then'),(1272225,'is','is'),(1272226,'unique','unique'),(1272227,'has','has'),(1272228,'short','short'),(1272229,'half-life','half-life'),(1272230,'does','does'),(1272231