CREATE DEFINER=`brett`@`%` FUNCTION `userEmailExists`( 
    email NVARCHAR ( 320 )
 ) RETURNS tinyint(1)
    READS SQL DATA
BEGIN

   DECLARE _email NVARCHAR(320);
   DECLARE _count BIGINT;
   DECLARE _emailExists TINYINT;
   
   SET _email = email;
    
   SET       _count  = (
      SELECT   COUNT(*)
      FROM     User
      WHERE  User.userEmail = _email
      AND        User.validated = 1
   );
   
   IF _count IS NULL THEN
      SET _count = 0;
   END IF;
   
   IF _count = 1 THEN
      SET _emailExists = 1;
   ELSE
      SET _emailExists = 0;
   END IF;
   
   RETURN _emailExists;
END ;;
