CREATE DEFINER=`brett`@`%` PROCEDURE `createUser`(
   email NVARCHAR(320),
   secret TEXT
)
BEGIN

   DECLARE _email NVARCHAR(320);
   DECLARE _secret TEXT;
   DECLARE _userId BIGINT;
   
   SET _email = email;
   SET _secret = secret;
   SET _userId = NULL;
  
   IF NOT EXISTS(
         SELECT *
         FROM    User
         WHERE   User.userEmail = _email
         FOR UPDATE)
   THEN
         
      INSERT INTO User(
         userEmail,
         logonSecret,
         newUserSecret,
         validated )
      VALUES  (_email, _secret, MD5(UUID()), 0 );
     
     SET _userId = LAST_INSERT_ID();
     
   ELSEIF EXISTS(
         SELECT   *
         FROM     User
         WHERE  User.userEmail = _email
         AND        validated = 0
         FOR UPDATE
   ) THEN
        UPDATE   User
        SET             logonSecret = _secret,
                             newUserSecret = MD5(UUID())
        WHERE    User.userEmail = _email;
        
        SET _userId = (
           SELECT userId
           FROM    User
           WHERE User.userEmail = _email
           FOR UPDATE
        );
        
   END IF;
   
   
   SELECT   userId,
                      newUserSecret
   FROM     User
   WHERE  User.userId = _userId;
   
END ;;
DELIMITER ;
