CREATE DEFINER=`brett`@`%` PROCEDURE `getValueId`(
   ownerId BIGINT,
   parentValueId BIGINT,
   objectIndex BIGINT,
   objectKey TEXT
)
BEGIN

   DECLARE _ownerId BIGINT;
   DECLARE _parentValueId BIGINT;
   DECLARE _objectIndex BIGINT;
   DECLARE _objectKey TEXT;
   DECLARE _objectKeyWordId BIGINT;
   DECLARE _valueId BIGINT;
   DECLARE _type VARCHAR(10);
   DECLARE _locked TINYINT;
   
   SET _ownerId = ownerId,
            _parentValueId = parentValueId,
            _objectIndex = objectIndex,
            _objectKey = objectKey,
            _objectKeyWordId = NULL,
            _valueId = NULL,
            _type = NULL,
            _locked = NULL;
        
            
    IF _objectKey IS NOT NULL THEN
        SELECT
            Word.wordId
        INTO
            _objectKeyWordId
        FROM
            Word
        WHERE
            Word.word = _objectKey;
            
        SELECT
            v.locked
        INTO
            _locked
        FROM
            Value AS v
        WHERE 
            v.ownerId = _ownerId
        AND
           v.parentValueId = 
               _parentValueId
       AND
           v.objectKeyWordId = _objectKeyWordId
       AND
           v.locked = 1;

       SELECT
            v.valueId
        INTO
            _valueId
        FROM
            Value AS v
        WHERE
            v.ownerId = _ownerId
         AND
             v.parentValueId = 
               _parentValueId
       AND
           v.objectKeyWordId = _objectKeyWordId
       AND
           v.locked = 0;
    
   ELSE
        SELECT
            v.locked
        INTO
            _locked
        FROM
            Value AS v
        WHERE 
            v.ownerId = _ownerId
        AND
           v.parentValueId = 
               _parentValueId
       AND
              v.objectIndex = _objectIndex
       AND
              v.locked = 1;

       SELECT
            v.valueId
        INTO
            _valueId
        FROM
            Value AS v
        WHERE
            v.ownerId = _ownerId
        AND
            v.parentValueId = 
               _parentValueId
       AND
              v.objectIndex = _objectIndex
       AND
              v.locked = 0;
   END IF;
   
   
   IF _valueId IS NOT NULL THEN
       SELECT
            v.type,
            v.objectIndex,
            w.word
       INTO
           _type,
           _objectIndex,
           _objectKey
       FROM
           Value AS v
       LEFT JOIN
           Word as w
       ON
           v.objectKeyWordId = w.wordId
       WHERE
           v.valueId = _valueId;
    END IF;
           
   IF _locked IS NULL THEN
       SET _locked = 0;
   END IF;
   
   SELECT
            _valueId AS valueId,
            _type AS type,
            _locked as locked,
            _objectIndex AS objectIndex,
            _objectKey AS objectKey;
            
END ;;
DELIMITER ;
