CREATE DEFINER=`brett`@`%` PROCEDURE `insertParentValueWords`(
    valueId BIGINT
)
BEGIN

    DECLARE _valueId BIGINT;
    
    SET _valueId = valueId;
    
    INSERT
    INTO
            ValueWord(
                valueId,
