    ON
        ValueWord.valueId = Value.parentValueId
    WHERE
        Value.valueId = $valueId
    AND
        NOT EXISTS(
            SELECT
                *
            FROM
               Value as v
            INNER JOIN
               ValueWord AS vw
            ON
                vw.valueId = v.parentValueId
            WHERE
                v.valueId = _valueId
            AND
                vw.wordId = ValueWord.wordId
        );
        
END ;;
