CREATE DEFINER=`brett`@`%` PROCEDURE `insertWord`(
    word TEXT,
    OUT wordId BIGINT
)
BEGIN

    DECLARE _word TEXT;
    DECLARE _wordId BIGINT;
    
    SET _word = word;
    
    INSERT
    INTO
        Word(
            word
        )
    SELECT
        _word
     WHERE
         NOT EXISTS(
             SELECT
                 *
             FROM
                 Word
             WHERE
                 Word.word = _word
         );
         
     SELECT
          Word.wordId
      INTO
          _wordId
      FROM
          Word
      WHERE
          Word.word = _word;
          
      SET wordId = _wordId;
      
END ;;
